import React, { useState } from 'react';
import { uploadDataset } from './services/api';

// Components
import FileUpload from './components/FileUpload';
import LoadingState from './components/LoadingState';
import QualityGauge from './components/QualityGauge';
import DimensionBars from './components/DimensionBars';
import InsightCard from './components/InsightCard';
import Recommendations from './components/Recommendations';
import ChatAssistant from './components/ChatAssistant'; // Import Chatbot

import './styles/Dashboard.css';

function App() {
  const [file, setFile] = useState(null);
  const [data, setData] = useState(null);
  const [loading, setLoading] = useState(false);

  // New state to remember selected profile
  const [currentProfile, setCurrentProfile] = useState('analytics');

  const handleFileChange = (uploadedFile) => {
    setFile(uploadedFile);
  };

  const handleAnalyze = async (selectedProfile) => {
  // Guard clause: Don't run if no file is selected
  if (!file) {
      // If triggered by dropdown but file is null (rare), just update state
      setCurrentProfile(selectedProfile); 
      return;
  }

  setLoading(true);
  setCurrentProfile(selectedProfile); // Update UI dropdown selection immediately

  try {
    // Pass the existing 'file' state and the NEW 'selectedProfile' to backend
    const result = await uploadDataset(file, selectedProfile);
    
    const mappedData = {
      dqs: result.dqs,
      dimensions: result.dimensions, 
      insights: result.insights,
      recommendations: result.recommendations
    };

    setData(mappedData);
  } catch (error) {
    console.error("Analysis failed", error);
    alert("Backend connection failed.");
  }
  setLoading(false);
};
// Inside App.js

return (
  <div className="app-container">
    <header className="navbar">
      <div className="nav-brand">
        <h2>DataQuality<span className="ai-text">AI</span></h2>
      </div>
      
      {/* --- NEW: LIVE PROFILE SELECTOR IN NAVBAR --- */}
      {/* This allows you to switch profiles anytime! */}
      <div className="nav-controls" style={{ display: 'flex', alignItems: 'center', gap: '15px' }}>
        <span style={{ fontSize: '0.9rem', color: '#8b9bb4' }}>Governance Profile:</span>
        <select 
          value={currentProfile} 
          onChange={(e) => handleAnalyze(e.target.value)} // <--- THIS TRIGGERS THE UPDATE
          disabled={loading || !file} // Disable if no file is loaded yet
          style={{
            padding: '8px 12px',
            borderRadius: '6px',
            background: 'rgba(255, 255, 255, 0.1)',
            border: '1px solid rgba(255, 255, 255, 0.2)',
            color: 'white',
            cursor: 'pointer'
          }}
        >
          <option value="analytics">General Analytics (Balanced)</option>
          <option value="kyc">KYC & Identity (Completeness Focus)</option>
          <option value="fraud">Fraud Detection (Uniqueness Focus)</option>
          <option value="merchant">Merchant Onboarding (Validity Focus)</option>
        </select>
      </div>

      <div className="nav-status">
        <div className="status-item">
          <span className="status-dot"></span>
          Status: <strong>{loading ? 'ANALYZING...' : 'ACTIVE'}</strong>
        </div>
      </div>
    </header>

    <main className="main-content">
      {/* Only show FileUpload if NO data exists yet */}
      {!data && !loading && (
        <FileUpload onFileChange={handleFileChange} onAnalyze={handleAnalyze} />
      )}

      {loading && <LoadingState />}

      {/* Show Dashboard when data exists */}
      {data && !loading && (
        <div className="dashboard-grid">
           {/* ... (Rest of your dashboard code stays the same) ... */}
           <div className="metrics-col">
              <div className="card">
                <QualityGauge score={data.dqs} />
              </div>
              <DimensionBars dimensions={data.dimensions} />
           </div>

           <div className="insights-col">
              <InsightCard insights={data.insights} />
              <Recommendations items={data.recommendations} /> 
              
              {/* Reset Button */}
              <button 
                className="secondary-btn" 
                onClick={() => { setData(null); setFile(null); }} 
                style={{marginTop:'1rem', width:'100%'}}
              >
                Upload New File
              </button>
           </div>
        </div>
      )}
    </main>
    
    <ChatAssistant />
  </div>
);
}

export default App;
